import { USER_LOGIN } from './types'

const initialState = {
    username: "",
}

const signinReducer = (state=initialState, action) => {
    switch(action.type) {
        case USER_LOGIN:
            return {
                ...state,
                username: action.payload
            }
            default: return state
    }
}

export default signinReducer
